    def is_valid_grammar(grammar, string):
        """
        Checks if a string is generated by a given grammar.
        """
        try:
            # Try to parse the grammar
            grammar_parse = parse_grammar(grammar)
            if grammar_parse:
                # Check if the string is a valid sequence of tokens
                if is_valid_sequence(string, grammar_parse):
                    return True
                else:
                    return False
            else:
                return False
        except:
            return False

    def parse_grammar(grammar):
        """
        Parses a grammar in Chomsky normal form.
        """
        grammar_map = {}
        for element in grammar:
            if element.startswith("S"):
                element = element[len("S"):].strip()
                if element:
                    grammar_map[element] = element
            elif element.startswith("NT"):
                element = element[len("NT"):].strip()
                if element:
                    grammar_map[element] = element
        return grammar_map

    def is_valid_sequence(sequence, grammar):
        """
        Checks if a sequence is valid according to a grammar.
        """
        if not sequence:
            return True

        for element in grammar:
            if element not in sequence:
                return False
        return True


